import React, { useEffect } from "react";
import { Box, Heading } from "@chakra-ui/react";
import supabase from "../client";

function TrendingProduct(props) {
  // eslint-disable-next-line

  return (
    <>
      <ProdContainer {...props}>
        <ProdContainerHeader />
        <ProdContainerItem />
      </ProdContainer>
    </>
  );
}
const ProdContainerHeader = () => {
  return (
    <>
      <Box
        px="1.5rem"
        py="1rem"
        display="flex"
        justifyContent={["center", "flex-start", "flex-start", "flex-start"]}
      >
        <Heading
          fontSize={["1.5rem", "1.75rem"]}
          fontWeight={["500", "600"]}
          as="h2"
          color="#2c2c2c"
        >
          <Box display={["inline-block"]}>Hot Products</Box>
          <Box
            borderBottom="2px solid #e97730"
            py={["1"]}
            pos={["relative"]}
            w={["70%", "60%"]}
            left={["4", "4"]}
            right={["4", "4"]}
          ></Box>
        </Heading>
      </Box>
    </>
  );
};

const ProdContainerItem = () => {
  // const [sBucketData, sSetBucketData] = [];

  async function BucketData() {
    const { data, error } = await supabase.storage.getBuckets('tempdata');
    // sSetBucketData(data);
    console.log(data);
    // console.log(sBucketData);
  }
  useEffect(() => {
    return () => {
      BucketData();
    };
  });

  return (
    <>
      <Box>hello</Box>
    </>
  );
};
const ProdContainer = ({ children, ...props }) => {
  return <Box>{children}</Box>;
};

export default TrendingProduct;
